import React from "react";
import ReactDOM from "react-dom";

const inputClick = () => console.log("Clicked");

const textH = {
  name: "Damir",
  age: 12
};

function Header() {
  return (
    <div>
      <h1>FFFFF</h1>
    </div>
  )
}


function App() {
  return (
    <div className="btt">
      <Header></Header>
      <h1>Hello, {textH.name}</h1>
      <h1></h1>
      <p>
        <input placeholder="999" onClick={inputClick}></input>
      </p>
      <p>
        {textH.age == 18 ? "YES" : "NO"}
      </p>
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(<App />);
